import React, { useState } from 'react';

const HistorialCitas = () => {
  const [fechaInicio, setFechaInicio] = useState('');
  const [fechaFin, setFechaFin] = useState('');
  const [nombreApellido, setNombreApellido] = useState('');
  const [cedula, setCedula] = useState('');
  const [medico, setMedico] = useState('');
  const [resultados, setResultados] = useState([
    {
      nombreCompleto: 'Juan Pérez',
      fechaUltimaCita: '2023-10-15',
      nombreMedico: 'Dr. Carlos Gómez',
      especialidad: 'Cardiología',
      diagnostico: 'Hipertensión arterial',
      siguienteCita: '2023-11-01',
    },
    {
      nombreCompleto: 'María López',
      fechaUltimaCita: '2023-10-10',
      nombreMedico: 'Dra. Ana Martínez',
      especialidad: 'Pediatría',
      diagnostico: 'Control de crecimiento',
      siguienteCita: '2023-11-05',
    },
  ]);

  const handleBuscar = (e) => {
    e.preventDefault();
    // Simular búsqueda
    alert('Búsqueda realizada');
  };

  return (
    <div className="historial-citas">
      <h2>Historial de Citas</h2>
      {/* Filtros de Búsqueda */}
      <form onSubmit={handleBuscar} className="filtros">
        <div className="filtro-row">
          <label>
            Rango de Fecha:
            <input
              type="date"
              value={fechaInicio}
              onChange={(e) => setFechaInicio(e.target.value)}
            />
            <input
              type="date"
              value={fechaFin}
              onChange={(e) => setFechaFin(e.target.value)}
            />
          </label>
        </div>
        <div className="filtro-row">
          <label>
            Nombre y Apellido:
            <input
              type="text"
              value={nombreApellido}
              onChange={(e) => setNombreApellido(e.target.value)}
            />
          </label>
          <label>
            Cédula:
            <input
              type="text"
              value={cedula}
              onChange={(e) => setCedula(e.target.value)}
            />
          </label>
        </div>
        <div className="filtro-row">
          <label>
            Médico:
            <select
              value={medico}
              onChange={(e) => setMedico(e.target.value)}
            >
              <option value="">Seleccione</option>
              <option value="Dr. Carlos Gómez">Dr. Carlos Gómez</option>
              <option value="Dra. Ana Martínez">Dra. Ana Martínez</option>
            </select>
          </label>
        </div>
        <button type="submit">Buscar</button>
      </form>

      {/* Grid de Resultados */}
      <div className="grid-resultados">
        <div className="grid-header">
          <div>Nombre Completo</div>
          <div>Fecha Última Cita</div>
          <div>Nombre del Médico</div>
          <div>Especialidad</div>
          <div>Diagnóstico</div>
          <div>Siguiente Cita</div>
        </div>
        {resultados.map((cita, index) => (
          <div className="grid-row" key={index}>
            <div>{cita.nombreCompleto}</div>
            <div>{cita.fechaUltimaCita}</div>
            <div>{cita.nombreMedico}</div>
            <div>{cita.especialidad}</div>
            <div>{cita.diagnostico}</div>
            <div>{cita.siguienteCita}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default HistorialCitas;
